// filepath: /home/musakerempe/Desktop/portfolio-website/src/pages/Skills.tsx
import React from 'react';

const Skills: React.FC = () => {
  return (
    <div className="container mx-auto text-center py-10">
      <h1 className="text-4xl font-bold mb-6">My Skills</h1>
      <ul className="space-y-4">
        <li className="text-lg">JavaScript / TypeScript</li>
        <li className="text-lg">React / Redux</li>
        <li className="text-lg">Tailwind CSS</li>
        <li className="text-lg">Node.js</li>
        <li className="text-lg">Git / GitHub</li>
      </ul>
    </div>
  );
};

export default Skills;
